import {
  NEW_ORDER_INSTANT_QUOTE,
  NEW_ORDER_FORM_VEHICLE_DETAILS,
} from "../constants/orderFormConstants";

export const instantQuote = (zipFrom, zipTo, pickUpDate, dropOffDate, numberOfCars) => {
    return {
      type: NEW_ORDER_INSTANT_QUOTE,
      payload: {
        zipFrom,
        zipTo,
        pickUpDate,
        dropOffDate,
        numberOfCars,
      },
    };
  };
  

export const vehicleDetails = (vehicleMake, vehicleModel, vehichleYear) => {
  return {
    type: NEW_ORDER_FORM_VEHICLE_DETAILS,
    payload: {
      vehicleMake,
      vehicleModel,
      vehichleYear,
    },
  };
};
